  \"2016-07-27T22:45:54.475925\",\n\t\"name\": \"annual-narrative-report-flint-hills-national-wildlife-refuge-burlington-kansas-septembe-31\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Flint Hills National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1966. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and vegetation control. Resource management is
  outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors, Refuge participation, hunting, violations, and safety.
  N-R forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
